import React, { Component } from 'react';
import PostData from './json.json';

class PostList extends Component {
  render() {
    return (
      <div className="Popular">
       {PostData.map((postDetail, index)=>{
           return <div>{postDetail.name}</div>
       })}

      </div>
    );
  }
}

export default PostList;
